import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import { connect } from 'react-redux'
import {logout} from './../../../actions/user.actions'
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import {Redirect} from 'react-router';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Drawer from '@material-ui/core/Drawer';
import {arrows_hamburger1} from 'react-icons-kit/linea/arrows_hamburger1'
import logo from './../img/logo.png';
// These are for the list inside the drawer
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import {ecommerce_wallet} from 'react-icons-kit/linea/ecommerce_wallet';
import {basic_lightbulb} from 'react-icons-kit/linea/basic_lightbulb';
import {basic_gear} from 'react-icons-kit/linea/basic_gear';
import {arrows_plus} from 'react-icons-kit/linea/arrows_plus';
import {basic_home} from 'react-icons-kit/linea/basic_home';
import {basic_notebook} from 'react-icons-kit/linea/basic_notebook';
import {arrows_remove} from 'react-icons-kit/linea/arrows_remove';
import {arrows_exclamation} from 'react-icons-kit/linea/arrows_exclamation';
import Avatar from '@material-ui/core/Avatar';
import Icon from 'react-icons-kit';

//  <div className="NavSearch">
//    <Button ><Icon icon={search} size={15}/></Button>
//  </div>
class MenuAppBar extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      redirect: false,
      token: undefined,
      currentTab: 0,
      drawer: false,
      truth: JSON.parse(sessionStorage.getItem('alpha')),
    };
    this.goNewRepo=this.goNewRepo.bind(this);
    this.goProfile=this.goProfile.bind(this);
    this.goHome=this.goHome.bind(this);
    this.goWallet=this.goWallet.bind(this);
    this.goIdeas=this.goIdeas.bind(this);
    this.goProjects=this.goProjects.bind(this);
    this.goPeople=this.goPeople.bind(this);
    this.llogin=this.llogin.bind(this);
    this.llogout=this.llogout.bind(this);
    this.sendHome=this.sendHome.bind(this);
    this.checkIfTabIsCorrect=this.checkIfTabIsCorrect.bind(this);
  };

  toggleDrawer  (side, open)  {
    this.setState({
      [side]: open,
    });
  };

  sendHome(){
    if(this.props.logout) {console.log("now true"); this.props.history.go('/')}
  }

  handleChange  (event, checked)  {
    this.setState({ token: checked });
  };

  handleLogout ()  {
    this.setState({ token: false });
  };

  handleCreateAccount  ()  {
    this.props.history.push('/createaccount');
  };

  goNewRepo() {
    this.setState({ anchorEl: null });
    this.props.history.push(`/newrepo/${this.props.username}`);
  }

  goProfile() {
    this.setState({ anchorEl: null });
    this.props.history.push(`/source/${this.props.username}`);
  }

  goHome() {
    this.props.history.push('/');
  }

  goWallet() {
    this.setState({ anchorEl: null });
    this.props.history.push(`/wallet/${this.props.username}/`);
  }

  goIdeas() {
    this.props.history.push('/explore/ideas');
  }

  goProjects() {
    this.props.history.push('/explore/projects');
  }

  goPeople() {
    this.props.history.push('/explore/people');
  }

  llogin(key){
    this.props.history.push('/login')
  }

  llogout(){
    this.props.dispatch(logout())
  }

  checkLoggedIn(){
    const user = JSON.parse(localStorage.getItem('user'));
    if (user===null || user===undefined) {
      this.setState({token:false})
    } else {
      this.setState({token:user.authToken})
    }
  }

  handleTabChange  (tabNum) {
    this.setState({ currentTab:tabNum });
    if (tabNum === 0) {
      this.goIdeas();
    }
    else if (tabNum === 1) {
      this.goProjects();
    }
    else if (tabNum === 2) {
      this.goPeople();
    }
  };

  checkIfTabIsCorrect(){
    if (this.props.location.pathname==="/explore/ideas") {
      this.setState({currentTab:0});
    }
    else if (this.props.location.pathname==="/explore/projects") {
      this.setState({currentTab:1});
    }
    else if (this.props.location.pathname==="/explore/people") {
      this.setState({currentTab:2});
    }
  }

  render() {
    if(this.props.logout) return <Redirect to="/"/>
    return (
      <div className="Navbar">
        <AppBar className="AppBar" position="static" elevation={3}>
          <Toolbar>
            <div className="Logo">
              <Typography variant="title" color="inherit">
                <div className="NavbarTitle" onClick={this.goHome}>
                  <img className="LogoImage" src={logo} alt="source"/>
                </div>
              </Typography>
            </div>
            <div className="Tabs">
              <Tabs value={this.state.currentTab} indicatorColor="primary">
                <Tab label="Ideas" onClick={()=>this.handleTabChange(0)} />
                <Tab label="Projects" onClick={()=>this.handleTabChange(1)}/>
                <Tab label="People" onClick={()=>this.handleTabChange(2)} />
              </Tabs>
            </div>

            <div className="Right">
              {(this.props.token!==false && this.props.token!==undefined) && (
                <div>
                  <Button onClick={this.toggleDrawer('right', true)}>
                    <Icon icon={arrows_hamburger1} size={25}/>
                  </Button>
                  <Drawer anchor="right" open={this.state.right} onClose={this.toggleDrawer('right', false)}>
                    <div
                      className="DrawerRight"
                      tabIndex={0}
                      role="button"
                      onClick={this.toggleDrawer('right', false)}
                      onKeyDown={this.toggleDrawer('right', false)}
                    >
                      <div className="DrawerRight">
                        <div className="ProfileSection">
                          <Avatar className="Avatar">.</Avatar>
                          <div className="UserInfo">
                            <Typography variant="title">{this.props.username}</Typography>
                            <Typography variant="body2">something</Typography>
                          </div>
                        </div>
                        <List component="nav">
                          <ListItem button onClick={this.goProfile}>
                            <ListItemIcon>
                              <Icon icon={basic_home} size={25} />
                            </ListItemIcon>
                            <ListItemText primary="Profile" />
                          </ListItem>
                          <ListItem button disabled>
                            <ListItemIcon>
                              <Icon icon={basic_notebook} size={25} />
                            </ListItemIcon>
                            <ListItemText primary="Projects" />
                          </ListItem>
                          <ListItem button disabled>
                            <ListItemIcon>
                              <Icon icon={arrows_exclamation} size={25} />
                            </ListItemIcon>
                            <ListItemText primary="Groups" />
                          </ListItem>
                          <ListItem button onClick={this.goWallet}>
                            <ListItemIcon>
                              <Icon icon={ecommerce_wallet} size={25} />
                            </ListItemIcon>
                            <ListItemText primary="Wallet" />
                          </ListItem>
                          <ListItem button disabled>
                            <ListItemIcon>
                              <Icon icon={basic_gear} size={25} />
                            </ListItemIcon>
                            <ListItemText primary="Account Settings" />
                          </ListItem>
                          <ListItem button onClick={this.llogout}>
                            <a href="/">
                              <ListItemIcon>
                                <Icon icon={arrows_remove} size={25} />
                              </ListItemIcon>
                              <ListItemText primary="Logout" />
                            </a>
                          </ListItem>
                        </List>
                        <Divider />
                        <List component="nav">
                          <ListItem button disabled>
                            <ListItemIcon>
                              <Icon icon={basic_lightbulb} size={25}/>
                            </ListItemIcon>
                            <ListItemText primary="New Idea" />
                          </ListItem>
                          <ListItem button onClick={this.goNewRepo}>
                            <ListItemIcon>
                              <Icon icon={arrows_plus} size={25} />
                            </ListItemIcon>
                            <ListItemText primary="New Project" />
                          </ListItem>
                        </List>
                      </div>
                    </div>
                  </Drawer>
                </div>
              )}
              {(this.props.token===false || this.props.token===undefined) && (
                <div>
                  <Button color="inherit" onClick={()=>{this.llogin(!this.props.auth)}}>Login</Button>
                  <Button color="inherit" onClick={this.handleCreateAccount}>Create Account</Button>
                </div>
              )}
            </div>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}


const mapStateToProps = (state) => {
  return {
    token: state.users.token,
    username: state.users.username,
    logout: state.users.logout,
    }
}

export default connect(mapStateToProps)(MenuAppBar);
